css:
@-moz-document url-prefix("https://torrentfreak.com") {
/*Body Text*/
.entry-content {
color: gray;
}

/*Body Background*/
#main {
    background: #333333;
}

/*Body Foreground*/
#wrap-main {
    background: #222222;
}

#wrap-page {
    background: #222222;
}

body, html {
    background: black;
}

/* Title Background*/
.entry-title {
    background: black;
}

/*Padding Accents*/
.entry-kilo .entry-title-wrapper, .entry-micro .entry-title-wrapper, .entry-nano .entry-title-wrapper {
    background: #222222;
}

.entry-kilo, .entry-micro, .entry-nano {
    border-bottom: 2px solid #e0005e;
}

.pbx-alt {
    background: #424242;
}
}
